import React, { useState, useEffect } from 'react';
import { ShoppingCart, Youtube, Instagram } from 'lucide-react';
import { Link } from 'react-router-dom';

const Header = () => {
  const [windowWidth, setWindowWidth] = useState(window.innerWidth);
  const [hoveredNav, setHoveredNav] = useState(null);

  useEffect(() => {
    const handleResize = () => {
      setWindowWidth(window.innerWidth);
    };
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const navItems = [
    {
      title: 'PROJECT',
      description: 'PROJECT 카테고리는 졸업전시회의 메인 페이지로, 팀 선택 화면을 통해 각 팀별 주제를 탐색할 수 있습니다.',
      subItems: ['MAIN THEME', 'LOOK BOOK', 'RUNWAY', 'DESIGNER']
    },
    {
      title: 'STORE',
      description: 'STORE 카테고리는 졸업전시회와 관련된 다양한 상품을 소개하는 공간으로, 관람객이 전시회의 특별한 기념품을 손쉽게 구매할 수 있도록 돕습니다.',
      subItems: ['전체 굿즈', '팀별 굿즈']
    },
    {
      title: 'SHOW INFO',
      description: 'SHOW INFO 카테고리는 졸업전시회의 전반적인 정보를 제공하는 중요한 공간입니다.',
      subItems: ['전시정보', '관람정보', '오시는 길']
    },
    {
      title: 'BEHIND',
      description: 'BEHIND 카테고리는 졸업전시회의 뒷이야기를 담아 관람객에게 새로운 시각을 제공합니다.',
      subItems: ['SHOW BEHIND', 'BROCHURE BEHIND', 'MAKING BEHIND']
    },
    {
      title: 'ARCHIVE',
      description: '과거의 전시 기록들을 보관하고 있습니다.',
      subItems: ['2024', '2023', '2022']
    }
  ];

  return (
    <header className="w-full bg-black text-white">
      <div className="container mx-auto px-4">
        {/* Top Bar */}
        <div className="flex justify-between items-center py-4">
          {/* Social Icons */}
          <div className="flex gap-4">
            <a href="https://youtube.com" target="_blank" rel="noopener noreferrer">
              <Youtube className="w-6 h-6 text-white hover:text-gray-300" />
            </a>
            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
              <Instagram className="w-6 h-6 text-white hover:text-gray-300" />
            </a>
          </div>

          {/* Title - Responsive positioning */}
          <h1 className={`text-lg font-bold transition-all duration-300 ${
            windowWidth < 768 ? 'absolute left-1/2 -translate-x-1/2' : ''
          }`}>
            2025 KUAD GRADUATION FASHION SHOW
          </h1>

          {/* Cart Icon */}
          <div>
            <button className="relative">
              <ShoppingCart className="w-6 h-6 text-white hover:text-gray-300" />
            </button>
          </div>
        </div>

        {/* Logo */}
        <div className="text-center py-4">
          <Link to="/" className="text-4xl font-bold text-white hover:text-gray-300">
            SOMA
          </Link>
        </div>

        {/* Navigation */}
        <nav className="relative">
          <ul className="flex justify-center gap-8 py-4 border-t border-b border-gray-700">
            {navItems.map((item) => (
              <li
                key={item.title}
                className="relative"
                onMouseEnter={() => setHoveredNav(item.title)}
                onMouseLeave={() => setHoveredNav(null)}
              >
                <Link 
                  to={`/${item.title.toLowerCase()}`} 
                  className="font-medium text-white hover:text-gray-300"
                >
                  {item.title}
                </Link>
                
                {/* Hover Menu */}
                {hoveredNav === item.title && (
                  <div className="absolute top-full left-0 w-screen bg-black shadow-lg z-50">
                    <div className="container mx-auto px-4 py-6 grid grid-cols-3">
                      {/* Description */}
                      <div className="col-span-1 pr-8">
                        <p className="text-gray-400">{item.description}</p>
                      </div>
                      
                      {/* Sub Navigation */}
                      <div className="col-span-2">
                        <ul className="grid grid-cols-2 gap-4">
                          {item.subItems.map((subItem) => (
                            <li key={subItem}>
                              <Link 
                                to={`/${item.title.toLowerCase()}/${subItem.toLowerCase()}`} 
                                className="text-white hover:text-gray-300"
                              >
                                {subItem}
                              </Link>
                            </li>
                          ))}
                        </ul>
                      </div>
                    </div>
                  </div>
                )}
              </li>
            ))}
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
